      <div class="text-container">
         <h2>Origem</h2>
         <p class="plain-text">
            O que se possui de obras e conhecimento sobre as pinturas romanas, infelizmente, se restringe à duas cidades: Pompeia e Herculano, que foram soterradas pela explosão do vulcão Vesúvio, em 79 d.C.
            As cinzas e o magma, apesar de terem arrasado boa parte da cidade, permitiu a preservação de algumas edificações, mantendo em boa qualidade a arte em seu interior.
         </p>

         <img src="images/pompeia.jpg" class="text-photo">
         <p class="image-description">
            Cidade de Pompeia atualmente, com o vulcão Vesúvio ao fundo

         </p>
      </div>
      <hr>
      <div class="text-container">
         <h2>Estilos</h2>



         <h3>Primeiro estilo</h3>
         <p class="plain-text">Denominado de incrustação (derivado de crustae, placas de pedra para revestimento), possuía teor abstrato e servia de decoração para as paredes, imitando o mármore. O reboco era dividido em segmentos retangulares, sendo pintados com cores e detalhes de acordo com a pedra desejada a se replicar.</p>
         <p class="plain-text">
            O estilo tem origem no período helenístico, sendo uma variação da pintura que era feita em altares e templos gregos. Esteve presente entre o século II a.C. até 80 d.C.
         </p>
         <img class="text-photo" src="images/primeiroEstilo.jpg">


         <h3>Segundo estilo</h3>
         <p class="plain-text">
            Também chamado de arquitetônico, se desenvolveu a partir de 80 a.C. É marcado por uma união da pintura com a arquitetura: as obras adotavam perspectiva, passavam ilusão de movimento, sendo planejadas juntamente com o cômodo para dar uma impressão de janela,
            de vista do mundo exterior. Ocupavam muitas vezes toda uma sala, utilizando de cenários complexos para disposição e harmonia das cenas.

         </p>
         <p class="plain-text">
            Uma das obras mais famosas desse estilo está presente na Vila dos Misterios, em Pompeia. Trata-se de um afresco de 1,62m de altura que circunda toda uma sala de jantar formal, ou triclínio.
            É composto por diversas cenas, possivelmente mostrando um ritual de iniciação ao deus do vinho e do prazer, Dioniso, em grego. Caracteriza-se pelas pessoas retratadas em escala natural e cores vibrantes, voltadas ao vermelho e laranja.
         </p>

         <img src="images/vila_dos_misterios.jpg" class="text-photo" alt="">
         <p class="image-description">
            Afresco restaurado na Villa dos Mistérios

         </p>


